import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaEnvelope, FaBars } from 'react-icons/fa';
import SearchBar from './SearchBar';

const Navbar = () => {
  const [showSearch, setShowSearch] = useState(false);
  const [showMobileMenu, setShowMobileMenu] = useState(false);

  const handleSearchIconClick = () => {
    setShowSearch(!showSearch);
  };

  const handleMobileMenuClick = () => {
    setShowMobileMenu(!showMobileMenu);
  };

  return (
    <nav style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '1rem', position: 'sticky', top: '0', backgroundColor: '#333', zIndex: '1000' }}>
      {/* logo*/}
      <div>
        <Link to="/">
          <img src="/images/logo-white.png" alt="Prizmpix Logo" style={{ height: '40px' }} />
        </Link>
      </div>

      {/* Mobile menu button */}
      <div style={{ display: 'none', cursor: 'pointer' }} className="mobile-menu-button" onClick={handleMobileMenuClick}>
        <FaBars size={24} />
      </div>

      {/* Navlinks*/}
      <ul className="nav-links" style={{ listStyle: 'none', display: 'flex', justifyContent: 'space-between', alignItems: 'center', margin: '0 auto', marginBottom: '0.5rem' }}>
        <li style={{ marginRight: '20px' }}><Link to="/">Home</Link></li>
        {/* <li style={{ marginRight: '20px' }}><Link to="/services">Services</Link></li> */}
        <li style={{ marginRight: '20px' }}><Link to="/about">About</Link></li>
        <li style={{ marginRight: '20px' }}><Link to="/collaboration">Collaboration</Link></li>
        <li style={{ marginRight: '20px' }}><Link to="/portfolio">Portfolio</Link></li>
      </ul>

      {/* Icons*/}
      <div style={{ display: 'flex', justifyContent: 'flex-end', alignItems: 'center', marginLeft: '20px' }}>
        <Link to="/contact" style={{ marginRight: '20px' }}><FaEnvelope size={24} /></Link>
        {/*<button style={{ backgroundColor: 'transparent', border: 'none', cursor: 'pointer', marginRight: '0px' }} onClick={handleSearchIconClick}>
           <FaSearch size={24} style={{ color: '#fff', transition: 'transform 0.2s ease-in-out' }} onMouseOver={(e) => e.target.style.transform = 'scale(1.1)'} onMouseOut={(e) => e.target.style.transform = 'scale(1)'} />
         </button>
         <Link to="/checkout" style={{ marginRight: '40px' }}><FaShoppingCart size={24} /></Link>*/}
      </div>
      {showSearch && <SearchBar />}

      {/* Mobile menu */}
      {showMobileMenu && (
        <div className="mobile-menu" style={{ position: 'absolute', top: '100%', left: '0', width: '100%', backgroundColor: '#333', padding: '1rem' }}>
          <ul style={{ listStyle: 'none', padding: '0', margin: '0' }}>
            <li style={{ marginBottom: '10px' }}><Link to="/">Home</Link></li>
            {/* <li style={{ marginBottom: '10px' }}><Link to="/services">Services</Link></li> */}
            <li style={{ marginBottom: '10px' }}><Link to="/about">About</Link></li>
            <li style={{ marginBottom: '10px' }}><Link to="/collaboration">Collaboration</Link></li>
            <li style={{ marginBottom: '10px' }}><Link to="/portfolio">Portfolio</Link></li>
          </ul>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
